import Footer from './Components/Footer';
import Header from './Components/Header';
import faker from 'faker'

function App() {
  return (
    <div className="relative pb-10 min-h-screen">
      <Header />

        <img src = {faker.image.image()} alt="back"/>
        <img src = {faker.image.image()} alt="back"/>

        <Footer />
    </div>
  );
}

export default App;
